                    return "REQUEST_SIGNATURE"
                case  .REQUEST_SIGNATURE_RESPONSE:
                    return "REQUEST_SIGNATURE_RESPONSE"
                case  .BALANCE_INQUIRY:
                    return "BALANCE_INQUIRY"
                case  .BALANCE_INQUIRY_RESPONSE:
                    return "BALANCE_INQUIRY_RESPONSE"
                case  .REQUEST_TIP:
                    return "REQUEST_TIP"
                case  .REQUEST_TIP_RESPONSE:
                    return "REQUEST_TIP_RESPONSE"
                case  .CARD_DETAILS:
                    return "CARD_DETAILS"
                case  .CARD_DETAILS_RESPONSE:
                    return "CARD_DETAILS_RESPONSE"
                case .PARSE_UNKNOWN(let rawValue):
                    return rawValue            
            }
        }
    }
}